// import LessonPage from './LessonPage';

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginSignup />} />
        <Route path="/lesson" element={<LessonPage />} />
      </Routes>
    </Router>
  );
};

export default App;
